import React, {Component } from 'react';
import {Grid, Cell , List, ListItem, ListItemContent} from 'react-mdl';
import Skills from './Skills'


class skillsHome extends Component{
    render(){
        return(
            <div className="contact-body">
                <Grid className="contact-grid">
                    <Cell col={6}>

                    </Cell>

                    <Cell col={6}>
                        <h2>Skills</h2>
                        <Skills
                            skill="Angular"
                            progress={100}
                        />
                        <Skills
                            skill="Firebase"
                            progress={80}
                        />
                         <Skills
                            skill="HTML"
                            progress={100}
                        />
                        <Skills
                            skill="SCSS"
                            progress={100}
                        />
                        <Skills
                            skill="NodeJS"
                            progress={50}

                        />
                        <Skills
                            skill="React"
                            progress={30}
                        />
                    </Cell>


                </Grid>
            </div>
        )
    }
}

export default skillsHome;
